B.D5=new A.bd(B.oN,["Developer","About me","    I have been working in the software development market since 2014, and over that time I have been collecting experiences in different languages \u200b\u200band tools. I have specialties in back-end and mobile development.\n\n    I look for new and better ways to do my tasks and create my code. And I'm always ready to receive a review or learn something new. I like to keep my projects organized and always meet deadlines.\n\n    Besides being a developer, I like to play sports like soccer and volleyball, I like to go for a walk when possible. An anime fan, I like the latest releases like Demon Slayer and Jujutsu Kaisen. I love to travel and I have already visited the city of Toronto in Canada, and I dream of visiting New York.\n\n    Contact me through social media. :D\n  ","Programming languages","Frameworks","Others"],t.hD)
B.D6=new A.bd(B.oN,["Desenvolvedor","Sobre mim","    Atuo no mercado de desenvolvimento de softwares desde 2014, e ao longo desse tempo venho colecionado experiencias em diversas linguagens e ferramentas. Possuo especialidades em desenvolvimento back-end e mobile.\n\n    Busco novas e melhores maneiras de realizar minhas tarefas e criar meus c\xf3digos. E sempre estou pronto para receber uma cr\xedtica ou aprender algo novo. Gosto de manter meus projetos organizados e sempre cumprir prazos.\n\n    Al\xe9m de um desenvolvedor, gosto de praticar esportes como futebol e v\xf4lei, gosto de fazer uma caminhada quando poss\xedvel. F\xe3 de animes, gosto dos \xfaltimos lan\xe7amentos como Demon Slayer e Jujutsu Kaisen. Gosto muito de viajar e j\xe1 conheci a cidade de Toronto no Canada, e tenho sonho de conhecer New York.\n\n    Entre em contato comigo atrav\xe9s das redes sociais. :D\n  ","Linguagens de programa\xe7\xe3o","Frameworks","Outros"],t.hD)
